import InterestService from '../services/interests.service'

class Interests {

    getAllAvailableInterests = () => {
        var interest_list = [];
        InterestService.getInterestList().then(data => {
            interest_list = data.interests;
        })
    }
    alist = this.getAllAvailableInterests();

    getAvailableInterests = (array) => {
        var list = this.alist.filter(function(e) {
            return !(array.includes(e));
        });
        return list;
    }
}

export default new Interests();
